import React from 'react';
import Head from "next/head";
import { Layout } from "../components";

import '../styles/normalize.scss';
import '../styles/global.scss';

const HomePage = () =>{
  return (
    <Layout>
      <Head>
        <title>Welcome</title>
      </Head>
      <h1>Latest</h1>
    </Layout>
  )
};

export default HomePage
